from collections import Counter
class Solution:
    def min_window(self, s: str, t: str) -> str:
        candidates = {}
        start_index = -1
        index=[]
        temp = list(t)
        c_temp = Counter(temp)
        print(sorted(c_temp.keys()))
        c_empty = Counter()
        slen = len(s)
        tlen = len(t)
        if slen < tlen:
            return ""
        if s == t:
            return s
        min_len = slen
        flag = 0
        if t in s:
            return t
        for i, char in enumerate(s,0):
            if flag==1:
                break
            if char in temp:
                index.append(i)
                if start_index==-1:
                    start_index = i
                while c_temp-Counter(s[start_index:i+1])== c_empty and index !=[]:
                    if len(s[start_index:i+1])<= min_len:
                        candidates[i-start_index] = s[start_index:i+1]
                        min_len = i-start_index
                        if min_len == (tlen-1):
                            flag = 1
                            break
                    start_index = index.pop(0)
                    if len(s[start_index:])<tlen:
                        flag = 1
                        break
        #print((index))
        #print(candidates)
